import React from "react";
import BodyContainer from "../components/BodyContainer";

const MainPage = () => {
    return (
        <BodyContainer className="pt-[60px] md:pt-[100px]">
            <div className="pt-4">
                <span className="font-semi-bold font-16 color-green-5e">Daily TIP. </span>
                <span className="font-regular-400"></span>
                다가오는 장마철 천연 정화석을 구비하여 습기를 제거해보세요.
            </div>
        </BodyContainer>
    );
};

export default MainPage;
